import React from 'react';
import UserLoginPage from './Pages/UserLoginPage';
import UserSignUpPage from './Pages/UserSignUpPage';
import MainPage from './Pages/MainPage';
import DetailPage from './Pages/DetailPage';
import SearchPage from './Pages/SearchPage';
import ReviewPage from './Pages/ReviewPage';
import LOGIN from './Pages/LOGIN';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Route path='/signup' exact render={() => <UserSignUpPage/>}/>
      <Route path='/login' exact render={() => <UserLoginPage/>}/>
      <Route path='/main/:userId' render={() => <MainPage/>}/>
      <Route path='/details/:businessId/:userId' render={()=> <DetailPage/>}/>
      <Route path='/search/:userId' render={()=> <SearchPage/>}/>
      <Route path='/review/:businessId/:userId' render={()=> <ReviewPage/>}/>
    </BrowserRouter>
  );
}

export default App;
